import React from "react";
import PropTypes from "prop-types";
import { Image } from "react-native";
import { Container, Content, View } from "native-base";

import Header from "../../components/Header";
import Footer from "../../components/Footer";
import Button from "../../components/Button";
import Typography from "../../components/Typography";

import Illustration from "../../assets/images/failed-illu.png";
import global from "../../utils/GlobalStyles";

export default function FailedUpdate({ navigation }) {
  return (
    <Container>
      <Header logo={false} menu={false} close transparent />

      <Content style={global.wrapper}>
        <View style={global.content}>
          <Typography text="Your password was not updated." type="title2" />
          <Image resizeMode="contain" style={[global.illuSeparator, { height: 327, width: "100%" }]} source={Illustration} />
        </View>
      </Content>

      <Footer>
        <Button full variant="default-outlined" text="TRY AGAIN" />
      </Footer>
    </Container>
  );
}

FailedUpdate.propTypes = {
  navigation: PropTypes.objectOf(PropTypes.any).isRequired,
};
